import React from 'react';
import styled from 'styled-components';

const SignupContainer = styled.div`
  width: 100%;
  background: #2c3e50;
  height: 400px;
`;

const Input = styled.input`
  margin-top: 20px;
  margin-left: 105px;
  height: 25px;
  border: none;
  border-radius: 2px;
  &.first,
  &.last,
  &.confirm {
    width: 250px;
  }
  &.email {
    width: 175px;
  }
  &.password {
    width: 125px;
    margin-left: 6px !important;
  }
`;

const ButtonSubmit = styled.button`
  margin-top: 20px;
  margin-left: 105px;
  height: 25px;
  border: none;
  border-radius: 2px;
`;

const Signup = () => {
  return (
    <SignupContainer>
      <Input type="text" className="first" placeholder="First Name" />
      <Input type="text" className="last" placeholder="Last Name" />
      <Input type="email" className="email" placeholder="Email" />
      <Input type="password" className="password" placeholder="Password" />
      <Input type="password" className="confirm" placeholder="Confirm Password" />
      <ButtonSubmit>Send</ButtonSubmit>
    </SignupContainer>
  );
};

export default Signup;
